558, event)" href="/qa/res/10558#10558">No.</a><a class="post_no" onclick="return citeReply(10558)" href="/qa/res/10558#q10558">10558</a><a href="/qa/res/10558">[Reply]</a></p><div class="body">How do I stop being attracted to teen girls?<br/>It makes me feel like a creep.</div></div><div class="post reply" id="reply_10561"><p class="intro"><input type="checkbox" class="delete" name="delete_10561" id="delete_10561" /><label for="delete_10561"><a class="sage" href="javascript:void(0); sage%20"><span class="name">Anonymous</span></a> <time datetime="2019-09-25T20:50:54Z">09/25/19 (Wed) 20:50:54</time></label>&nbsp;<a class="post_no" id="post_no_10561" onclick="return highlightReply(10561, event)" href="/qa/res/10558#10561">No.</a><a class="post_no" onclick="return citeReply(10561)" href="/qa/res/10558#q10561">10561</a></p>        <div class="files">    </div>         <div class="body" >How do I stop being into sadomasochism? It makes me feel like shit.<br/>I am serious. I feel nauseous after reading NTR.</div></div><br/><div class="post reply" id="reply_10563"><p class="intro"><input type="checkbox" class="delete" name="delete_10563" id="delete_10563" /><label for="delete_10563"><span class="name">Anonymous</span> <time datetime="2019-09-25T21:06:09Z">09/25/19 (Wed) 21:06:09</time></label>&nbsp;<a class="post_no" id="post_no_10563" onclick="return highlightReply(10563, event)" href="/qa/res/10558#10563">No.</a><a class="post_no" onclick="return citeReply(10563)" href="/qa/res/10558#q10563">10563</a></p>        <div class="files">    </div>         <div class="body" >How do I stop being into hypnosis? Goddess treats me like shit and I don't even remember how I got into this relationship.</div></div><br/><br class="clear"/><hr/></div><h2><a href="/qa">/qa/</a></h2><div class="thread" id="thread_10198" data-board="qa">    <div class="files">            <div class="file"><p class="fileinfo">File: <a href="/qa/src/1569208325127.png">1569208325127.png</a> <span class="unimp